function generateBingoCards(count: number, questions: string[]): Map<number, string[][]> {
  if (questions.length < 25) {
    throw new Error(
      "You need at least 25 questions to generate a full Bingo card."
    );
  }

  const bingosCard: Map<number, string[][]> = new Map<number, string[][]>();
    for (let j = 0; j < count; j++) {
        // Shuffle the questions array using Fisher-Yates algorithm
        const shuffledQuestions = [...questions];
        for (let i = shuffledQuestions.length - 1; i > 0; i--) {
            const j = Math.floor(Math.random() * (i + 1));
            [shuffledQuestions[i], shuffledQuestions[j]] = [
            shuffledQuestions[j],
            shuffledQuestions[i],
            ];
        }

        // Create a 5x5 Bingo card
        const bingoCard: string[][] = [];
        for (let i = 0; i < 5; i++) {
            bingoCard.push(shuffledQuestions.slice(i * 5, i * 5 + 5));
        }

        bingosCard.set(j, bingoCard);
    }

  return bingosCard;
}

function exportBingoCardToPDF(englishCount: number, frenchCount: number) {
  const englishCards = generateBingoCards(englishCount, english_questions);
  const frenchCards = generateBingoCards(frenchCount, french_questions);
  const doc = new jsPDF();

for (let i = 0; i < englishCount; i++) {
    generateCards(doc, englishCards.get(i) ?? [], i < englishCount - 1, "English");
}

for (let i = 0; i < frenchCount; i++) {
    if (i == 0) doc.addPage()
  generateCards(doc, frenchCards.get(i) ?? [], i < frenchCount - 1, "Franais");
}

  // Save the PDF
  doc.save("bingo_card.pdf");
}

function generateCards(doc: jsPDF, bingoCard: string[][], addPage: boolean, language: string) {
  doc.addImage(imgData, "PNG", 10, 7, 20, 20, "", "FAST"); // Adjust the position and size as needed
  doc.addImage(imgData, "PNG", 180, 7, 20, 20, "", "FAST"); // Adjust the position and size as needed

  // Set font and title
  doc.setFont("Montserrat-Medium", "normal");
  doc.setFontSize(22);
  doc.text("ICE-BREAKING BINGO CASSE-GLACE", 105, 20, { align: "center" });

  // Draw the Bingo grid
  const startX = 5;
  const startY = 30;
  const cellSizeX = 40;
  const cellSizeY = 50;

  doc.setFont("Montserrat-Medium", "normal");
  doc.setFontSize(12);

  doc.text(language == "English" ? "Find someone who..." : "Trouve quelqu'un qui...", 105, 27, { align: "center" });
  doc.text(language, 205, 290, { align: "right" });

  for (let row = 0; row < 5; row++) {
    for (let col = 0; col < 5; col++) {
      const x = startX + col * cellSizeX;
      const y = startY + row * cellSizeY;

      // Draw cell border
      doc.rect(x, y, cellSizeX, cellSizeY);

      // Add text in the cell with wrapping
      const text = bingoCard[row][col];
      const textLines = doc.splitTextToSize(text, cellSizeX - 4); // Wrap text to fit within the cell
      textLines.forEach((line: string, lineIndex: number) => {
        const lineHeight = 4;
        const textY =
          y +
          (cellSizeY / 2 - (textLines.length * lineHeight) / 2) +
          lineIndex * lineHeight;
        doc.text(line, x + cellSizeX / 2, textY - 10, { align: "center" });
      });

      doc.text(language == "English" ? "Name:" : "Nom:", x + 2, y + 32, { align: "left" });
      doc.line(x + 2, y + 37, x + 2 + 36, y + 37);
      doc.text(language == "English" ? "School:" : "cole:", x + 2, y + 42, { align: "left" });
      doc.line(x + 2, y + 47, x + 2 + 36, y + 47);
    }
  }

  doc.addPage()

  if (addPage) doc.addPage();
}

